                        box-shadow: 0px 0px 30px 6px rgba(0,0,0,0.1);
                        z-index: 10;
                    }

                    .grey-bg {
                        background: #efefef;
                        position: absolute;
                        top:0;
                        bottom:0;
                        right: 0;
                        left: 0;
                        opacity: 0;
                        transition: all .3s ease-in-out;
                        overflow: hidden;

                        &:hover {
                            opacity: 0.9;

                            .project-info {
                                .project-details {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                                .project-title {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                            }
                        }

                        .project-info {
                            padding: 56px;
                            position: absolute;
                            width: 100%;
                            bottom: 0;

                            .project-details {
                                position: relative;
                                font-size: 1.1rem;
                                text-transform: capitalize;
                                margin: 0 0 1rem 0;
                                transform: translate3d(-200px, 0, 0);
                                opacity: 0;
